## Tooltip

The Tooltip component is a simple component that shows a message when the user hovers over an element.

```jsx
import React, { useContext } from 'react';
import TooltipContext from './TooltipContext';

const Tooltip = ({ children, message }) => {
  const { setTooltip } = useContext(TooltipContext);

  return (
    <div
      onMouseEnter={() => setTooltip(message)}
      onMouseLeave={() => setTooltip(null)}
    >
      {children}
      {tooltip && <div className="tooltip">{tooltip}</div>}
    </div>
  );
};

export default Tooltip;
```

The Tooltip component uses the `useContext` hook to access the `TooltipContext` and update the `tooltip` state when the user hovers over the element. The `tooltip` state is used to show or hide the tooltip message.

## TooltipContext

The `TooltipContext` is a React context that provides the `tooltip` state and the `setTooltip` function to the `Tooltip` component.

```jsx
import React, { createContext, useState } from 'react';

const TooltipContext = createContext();

const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  return (
    <TooltipContext.Provider value={{ setTooltip }}>
      {children}
      {tooltip && <div className="tooltip">{tooltip}</div>}
    </TooltipContext.Provider>
  );
};

export { TooltipContext, TooltipProvider };
```

The `TooltipContext` is created using the `createContext` function from React. The `TooltipProvider` component provides the `tooltip` state and the `setTooltip` function to the `Tooltip` component using the `TooltipContext.Provider` component.

## Usage

To use the `Tooltip` component, you need to wrap your application in the `TooltipProvider` component.

```jsx
import React from 'react';
import { TooltipProvider } from './TooltipContext';
import Tooltip from './Tooltip';

const App = () => {
  return (
    <TooltipProvider>
      <div>
        <Tooltip message="This is a tooltip">Hover over me</Tooltip>
      </div>
    </TooltipProvider>
  );
};

export default App;
```

In the example above, the `TooltipProvider` component is used to provide the `tooltip` state and the `setTooltip` function to the `Tooltip` component. The `Tooltip` component is used to show a tooltip message when the user hovers over the "Hover over me" text.

## Conclusion

In this article, we have learned how to create a Tooltip in NextJS using React Context. The Tooltip component is a simple component that shows a message when the user hovers over an element. The TooltipContext is a React context that provides the tooltip state and the setTooltip function to the Tooltip component. By using the TooltipProvider component, we can provide the tooltip state and the setTooltip function to the Tooltip component. This way, we can close the previously opened Tooltip and so on.
